import React, { useState } from 'react';
import { Routes, Route, Link, NavLink, BrowserRouter as Router, useNavigate, useParams, BrowserRouter } from 'react-router-dom';
import './Home.css';
import logo from '../images/logo.png';

const Home = () => {
   return <> 
        <h1>Home Page Details -- probably just some graphics and a link to create a login </h1>
        <div className='homeLogo'><img src={logo} alt='Logo' /></div>

        <h1> Featured Posts</h1>
       </> 
}
export default Home;
